public class MockSettingsImpl implements org.mockito.MockSettings {
    private static final long serialVersionUID = 4475297236197939568L;

    private java.lang.Class<?>[] extraInterfaces;

    private java.lang.String name;

    private java.lang.Object spiedInstance;

    private org.mockito.stubbing.Answer<java.lang.Object> defaultAnswer;

    private org.mockito.internal.util.MockName mockName;

    private boolean serializable;

    public org.mockito.MockSettings serializable() {
        this.serializable = true;
        return this;
    }

    public org.mockito.MockSettings extraInterfaces(java.lang.Class<?>... extraInterfaces) {
        if ((extraInterfaces == null) || (extraInterfaces.length == 0)) {
            new org.mockito.exceptions.Reporter().extraInterfacesRequiresAtLeastOneInterface();
        }
        for (java.lang.Class<?> i : extraInterfaces) {
            if (i == null) {
                new org.mockito.exceptions.Reporter().extraInterfacesDoesNotAcceptNullParameters();
            } else if (!i.isInterface()) {
                new org.mockito.exceptions.Reporter().extraInterfacesAcceptsOnlyInterfaces(i);
            }
        }
        this.extraInterfaces = extraInterfaces;
        return this;
    }

    public org.mockito.internal.util.MockName getMockName() {
        return mockName;
    }

    public java.lang.Class<?>[] getExtraInterfaces() {
        return extraInterfaces;
    }

    public java.lang.Object getSpiedInstance() {
        return spiedInstance;
    }

    public org.mockito.MockSettings name(java.lang.String name) {
        this.name = name;
        return this;
    }

    public org.mockito.MockSettings spiedInstance(java.lang.Object spiedInstance) {
        this.spiedInstance = spiedInstance;
        return this;
    }

    @java.lang.SuppressWarnings("unchecked")
    public org.mockito.MockSettings defaultAnswer(org.mockito.stubbing.Answer defaultAnswer) {
        this.defaultAnswer = defaultAnswer;
        return this;
    }

    public org.mockito.stubbing.Answer<java.lang.Object> getDefaultAnswer() {
        return defaultAnswer;
    }

    public boolean isSerializable() {
        return serializable;
    }

    public void initiateMockName(java.lang.Class classToMock) {
        mockName = new org.mockito.internal.util.MockName(name, classToMock);
    }
}

